import React from 'react';
import { Link } from 'react-router-dom';

const Home = () =>{
  return (
    <div>
      
      <header>
        <div id="menu">
          <div id="esquerda"><Link to="/disciplina" style={{color: "white"}}>Disciplina</Link></div>
          <div id="direita"><Link to="/aluno" style={{color: "white"}}>Aluno</Link></div>   
        </div>
      </header>     
    </div>
  );
}

export default Home;
